import React from 'react';
import produtos from '../../data/produtos';

export default (props) => {
    return (
        <table>
               {produtos.map((item) => {
                   return [
                        <tr>
                            <td>{item.id}</td>,
                            <td>{item.produto}</td>,
                            <td>{item.preço}</td>
                        </tr>
                    ];
                })}
        </table>
    )
}
